/**
 * Serie de functii care efectueaza cele mai
 * frecvente operatii matematice pe numere
 * oricat de mari.
**/

#include <stdio.h>
#include <string.h>

class Huge {
public:
    int Semn;
    int Cont;
    int V[8000];

    Huge() {
        *this = 0;
    }

    Huge& operator =(long long Val) {
        this->V[0] = this->Cont = 0;
        if (Val < 0) {
            Val = -Val;
            this->Semn = -1;
        } else {
            this->Semn = 1;
        }
        for (; Val; ) {
            this->V[this->Cont++] = (int)(Val % 100000000);
            Val -= Val % 100000000;
            Val /= 100000000;
        }
        if (this->Cont) --this->Cont;
        return *this;
    }

    Huge& operator =(const Huge& B) {
        this->Cont = B.Cont;
        this->Semn = B.Semn;
        memcpy(this->V, B.V, sizeof(int) * (this->Cont + 1));
        return *this;
    }

    /*returneaza 1 daca A>B
                 0 daca A=B
                -1 daca A<B
    */
    int Comparare(const Huge &A, const Huge &B) const {
        if (A.Semn != B.Semn) {
            if (A.Semn==1) return 1;
            else return -1;
        } else {
            if (A.Cont > B.Cont) {
                if (A.Semn == 1) return 1;
                else return -1;
            } else if (A.Cont < B.Cont) {
                if (A.Semn == 1) return -1;
                else return 1;
            } else {
                int i;
                for (i = A.Cont; A.V[i] == B.V[i] && i >= 0; --i);
                if (i >= 0) {
                    if (A.V[i] > B.V[i]) {
                        if (A.Semn == 1) return 1;
                        else return -1;
                    } else {
                        if (A.Semn == 1) return -1;
                        else return 1;
                    }
                } else {
                    return 0;
                }
            }
        }
    }

    bool operator >(const Huge& B) const {
        return Comparare(*this, B) == 1;
    }

    bool operator <(const Huge& B) const {
        return Comparare(*this, B) == -1;
    }

    bool operator >=(const Huge& B) const {
        return Comparare(*this, B) != -1;
    }

    bool operator <=(const Huge& B) const {
        return Comparare(*this, B) != 1;
    }

    bool operator ==(const Huge& B) const {
        return Comparare(*this, B) == 0;
    }

    bool operator !=(const Huge& B) const {
        return Comparare(*this, B) != 0;
    }

    bool operator >(const long long& b) const {
        Huge B;
        B = b;
        return Comparare(*this, B) == 1;
    }

    bool operator <(const long long& b) const {
        Huge B;
        B = b;
        return Comparare(*this, B) == -1;
    }

    bool operator >=(const long long& b) const {
        Huge B;
        B = b;
        return Comparare(*this, B) != -1;
    }

    bool operator <=(const long long& b) const {
        Huge B;
        B = b;
        return Comparare(*this, B) != 1;
    }

    bool operator ==(const long long& b) const {
        Huge B;
        B = b;
        return Comparare(*this, B) == 0;
    }

    bool operator !=(const long long& b) const {
        Huge B;
        B = b;
        return Comparare(*this, B) != 0;
    }



    Huge operator *(int Val) const {
        Huge A;
        if (Val < 0) {
            Val = -Val;
            if (this->Semn == -1) A.Semn = 1;
            else A.Semn = -1;
        } else {
            A.Semn = this->Semn;
        }
        int i;
        long long tmp;
        for (i = 0; i <= this->Cont + 1; ++i) {
            A.V[i] = 0;
        }
        for (i = 0; i <= this->Cont; ++i) {
            tmp = (long long)this->V[i] * Val + A.V[i];
            A.V[i] = (int)(tmp % 100000000);
            //A.V[i + 1] = (tmp - A.V[a]) / 100000000;
            A.V[i + 1] = (int)(tmp / 100000000);
        }
        if (A.V[this->Cont + 1]) {
            A.Cont = this->Cont + 1;
        } else {
            A.Cont = this->Cont;
        }
        return A;
    }

    Huge operator *(const Huge& C) const {
        Huge A;
        if (this->Semn == 1) {
            A.Semn = C.Semn;
        } else {
            if (C.Semn == -1) A.Semn = 1;
            else A.Semn = -1;
        }
        Huge Tmp;
        int i, j;
        for (i = 0; i <= this->Cont + C.Cont + 1; ++i) {
            A.V[i] = 0;
        }
        for (i = 0; i <= C.Cont; ++i) {
            Tmp = (*this) * C.V[i];
            for(j = 0; j <= Tmp.Cont; ++j) {
                A.V[i + j] += Tmp.V[j];
                A.Cont = i + j;
                if (A.V[i + j] >= 100000000) {
                    A.V[i + j] -= 100000000;
                    ++A.V[i + j + 1];
                    A.Cont = i + j + 1;
                }
            }
        }
        return A;
    }
    Huge& operator *=(Huge& B) {
        *this = *this * B;
        return *this;
    }

    Huge& operator *=(int B) {
        *this = *this * B;
        return *this;
    }

    void afisare(FILE *output) {
        int i;
        if (this->Semn == -1) fprintf(output, "-");
        fprintf(output, "%d", this->V[this->Cont]);
        for(i = this->Cont - 1; i >= 0; --i) {
            fprintf(output, "%.8d", this->V[i]);
        }
    }

    void afisare() {
        afisare(stdout);
    }
};

// Program scris special pentru depanarea functiilor.
int main(void) {
    freopen("tamplar.in","r",stdin);
    freopen("tamplar.out","w",stdout);
    int n;
    scanf("%d",&n);
    /*if(n==9999) {
        printf("");
        return 0;
    }*/
    Huge a;
    a=1;
    for(int i=2; i<n; ++i) a*=i;
    a.afisare();
    return 0;
}
